import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Data from "../data";

function dataEntry(data) {
    (<Note 
        key = {data.id}
    />)
}

function App() {
    return (
        <div>
            <Header />
            <Footer />
            {Data.map(dataEntry)};
        </div>
    );
}

export default App;
